Optimum is proudly participating in the Federal Government’s Affordable Connectivity Program (ACP), a longer-term $14 billion program that replaced the Emergency Broadband Benefit (EBB) Program. This program helps eligible low-income households that qualify based on Federal Government rules pay for Internet or Mobile service. It'll help ensure Americans can afford the connections they need for work, school, health care and more.
